      entered. Must be mm:ss.fff\")\r\n\r\n    if int(ss) >= 60:\r\n        raise
      ValueError(\"Cannot have more than 60 seconds in a minute.\")\r\n\r\n    return
      60*int(mm) + int(ss) + int(fff)/1000"
